"wrongParameterNameMethodCall", Messages.ModelValidatorImpl_InvalidStepParameter("namd", "name")}); result.add(new Object[]{"invalidParameterTypeMethodCall", Messages.ModelValidatorImpl_InvalidParameterType("class java.lang.String", "name", "1234")});  result.add(new Object[]{"perStageConfigEmptySteps", Messages.JSONParser_TooFewItems("/pipeline/stages/0/branches/0/steps", 0, 1)}); result.add(new Object[]{"perStageConfigMissingSteps", Messages.JSONParser_MissingRequiredProperties("/pipeline/stages/0/branches/0", "'steps'")}); result.add(new Object[]{"perStageConfigUnknownSection", "At /pipeline/stages/0: additional properties are not allowed"});  result.add(new Object[]{"unknownAgentType", Messages.ModelValidatorImpl_NoAgentType("[otherField, docker, dockerfile, label, any, none]")}); result.add(new Object[]{"invalidWrapperType", Messages.ModelValidatorImpl_InvalidSectionType("wrapper", "echo", "[catchError, node, retry, script, timeout, waitUntil, withContext, withEnv, ws]")});  result.add(new Object[]{"unknownBareAgentType", Messages.ModelValidatorImpl_InvalidAgent("foo", "[any, none]")}); result.add(new Object[]{"agentMissingRequiredParam", Messages.ModelValidatorImpl_MissingAgentParameter("otherField", "label")}); result.add(new Object[]{"agentUnknownParamForType", Messages.ModelValidatorImpl_InvalidAgentParameter("fruit", "otherField", "[label, otherField]")}); result.add(new Object[]{"notificationsSectionRemoved", "At /pipeline: additional properties are not allowed"}); result.add(new Object[]{"unknownWhenConditional", Messages.ModelValidatorImpl_UnknownWhenConditional("banana", "branch, environment, expression")});  result.add(new Object[]{"malformed", "Expected a ',' or '}' at character 243 of {"pipeline": {
" + "  "stages": [  {
" + "    "name": "foo",
" + "    "branches": [    {
" + "      "name": "default",
" + "      "steps": [      {
" + "        "name": "echo",
" + "        "arguments":         {
" + "          "isLiteral": true,
" + "          "value": "hello"
" + "
" + "      }]
" + "    }]
" + "  }],
" + "  "agent":   {
" + "    "isLiteral": true,
" + "    "value": "none"
" + "  }
" + "}}"});  return result; }

